import { useState } from "react";

const Records = () => {
  const [height, setHeight] = useState("");
  const [weight, setWeight] = useState("");
  const [bloodGroup, setBloodGroup] = useState("");
  const [medicalHistory, setMedicalHistory] = useState("");
  const [error, setError] = useState("");

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!height || !weight || !bloodGroup) {
      setError("Please fill in all required fields.");
      return;
    }

    try {
      // Get userId from localStorage (assuming it was stored during login)
      const userId = localStorage.getItem('userId');
      
      if (!userId) {
        setError("User not authenticated. Please login again.");
        window.location.href = '/signin';
        return;
      }

      const response = await fetch('http://localhost:8001/api/records', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'userId': userId
        },
        body: JSON.stringify({
          height: parseFloat(height),
          weight: parseFloat(weight),
          bloodGroup,
          medicalHistory
        })
      });

      if (response.ok) {
        window.location.href = '/dashboard';
      } else {
        const data = await response.json();
        setError(data.message || "Failed to save records");
      }
    } catch (err) {
      setError("No Server Response");
    }
  };

  return (
    <div className="h-screen flex items-center justify-center">
      <section className="w-[512px] bg-custombg p-4 flex flex-col border rounded-2xl">
        <h1 className="text-center text-white text-3xl mb-4">Medical Records</h1>
        
        {error && (
          <p className="bg-pink-100 text-red-600 font-bold p-2 mb-2 rounded">
            {error}
          </p>
        )}

        <form onSubmit={handleSubmit} className="flex flex-col space-y-4">
          <div>
            <label htmlFor="height" className="text-white font-bold text-xl">
              Height (cm):
            </label>
            <input
              type="number"
              id="height"
              value={height}
              onChange={(e) => setHeight(e.target.value)}
              required
              min="1"
              max="300"
              className="mt-1 block w-full px-3 py-2 rounded-md text-black text-lg"
            />
          </div>

          <div>
            <label htmlFor="weight" className="text-white font-bold text-xl">
              Weight (kg):
            </label>
            <input
              type="number"
              id="weight"
              value={weight}
              onChange={(e) => setWeight(e.target.value)}
              required
              min="1"
              max="500"
              className="mt-1 block w-full px-3 py-2 rounded-md text-black text-lg"
            />
          </div>

          <div>
            <label htmlFor="bloodGroup" className="text-white font-bold text-xl">
              Blood Group:
            </label>
            <select
              id="bloodGroup"
              value={bloodGroup}
              onChange={(e) => setBloodGroup(e.target.value)}
              required
              className="mt-1 block w-full px-3 py-2 rounded-md text-black text-lg"
            >
              <option value="">Select Blood Group</option>
              <option value="A+">A+</option>
              <option value="A-">A-</option>
              <option value="B+">B+</option>
              <option value="B-">B-</option>
              <option value="AB+">AB+</option>
              <option value="AB-">AB-</option>
              <option value="O+">O+</option>
              <option value="O-">O-</option>
            </select>
          </div>

          <div>
            <label htmlFor="medicalHistory" className="text-white font-bold text-xl">
              Past Medical History (Optional):
            </label>
            <textarea
              id="medicalHistory"
              value={medicalHistory}
              onChange={(e) => setMedicalHistory(e.target.value)}
              rows="4"
              className="mt-1 block w-full px-3 py-2 rounded-md text-black text-lg"
            />
          </div>

          <button
            type="submit"
            className="w-1/4 bg-white text-custombg font-bold py-2 rounded-md mt-4 self-center
              hover:bg-gray-100 transition-colors duration-200"
          >
            Submit
          </button>
        </form>
      </section>
    </div>
  );
};

export default Records;
